import React from 'react';
import { useLocation } from 'react-router-dom';

const MyInfoHeart = () => {
  const location = useLocation();
  const { restaurantInfo, isFavorite } = location.state;

  // 'restaurantInfo'가 없거나 'isFavorite'가 없는 경우에 대한 처리
  if (!restaurantInfo || typeof isFavorite === 'undefined') {
    return (
      <div>
        <p>찜 목록이 없습니다.</p>
      </div>
    );
  }

  // 받은 정보를 이용해서 작업 수행
  return (
    <div>
      <h2>음식점 이름: {restaurantInfo.title}</h2>
      <p>찜한 상태: {isFavorite ? '찜한 상태' : '찜하지 않은 상태'}</p>
      {/* 받은 정보를 이용한 다른 작업 */}
    </div>
  );
};

export default MyInfoHeart;
